css:
.repl-view {
  font-family: monospace;
  font-size: 14px;
  display: -webkit-flex;
  color: #444444;
  overflow: scroll;
  background-color: #f4f4f4;
  padding: 10px;
}
.repl-view ul {
  padding-left: 0px;
  width: 100%;
}
.repl-view li {
  list-style-type: none;
}
.repl-view ul.stacktrace li {
  color: #aaa;
}
.repl-view ul.stacktrace li.clojure {
  color: black;
}
.repl-view li.repl-entry {
  list-style-type: none;
  color: black;
  margin-bottom: 20px;
}
.repl-view li.repl-entry .evald-form {
  background-color: transparent;
  padding: 5px;
}
.repl-view li.repl-entry .evald-form code {
  white-space: pre;
  background-color: transparent;
  color: #777;
}
.repl-view li.repl-entry .output {
  padding: 5px;
}
.repl-view .raw-output {
  width: 100%;
}
.repl-view .rendered-output {
  padding: 10px;
  white-space: pre-wrap;
}
.repl-view .toggle-raw {
  text-align: center;
  width: 100%;
  background-color: #f4f4f4;
  padding: 3px;
  cursor: pointer;
  font-family: sans-serif;
}
.repl-view .toggle-raw:hover {
  background-color: #ffffff;
}
.repl-view ul.stacktrace {
  border-left: solid red 3px;
  padding-left: 10px;
}
.clojure.discard {
  font-style: italic;
}
.debug-atom-clojure {
  padding: 10px;
  background-color: #f4f4f4;
  width: 100%;
  height: 100%;
  overflow-y: scroll;
  color: #444444;
}
.debug-atom-clojure h1 {
  margin-top: 0;
}
